import React, { Component } from "react";

import ReactStoreIndicator from "react-score-indicator";

class Score extends Component {
  render() {
    return (
      <ReactStoreIndicator
        value={30}
        maxValue={10}
        lineWidth={15}
        lineGap={3}
        fadedOpacity={20}
      />
    );
  }
}
export default Score;
